import React, { Component } from 'react';



export default class ToDoItem extends Component {
    constructor(props){
        super(props);
    
        this.state = {
            items: items
        };
    }

  render() {
        return (
            this.state.items.map(function (index, item){
                let liColor = {
                    color: index.important ? 'tomato': 'black'
                }
                return <li className="list-group-item" key={item} style={liColor}>{index.label}</li>   
            })
        )
  }
}
